import React from 'react'

const HangmanDrawing = () =>{
    const head = <div style={{width:'50px', height:'50px', border:'solid 10px black', borderRadius:'100%', position:'absolute', top:'60px', right:'-30px' }}/>
    const body = <div style={{width:'10px', height:'100px', backgroundColor:'black', position:'absolute', top:'130px', right:'0px' }}/>
    const right_hand = <div style={{width:'90px', height:'10px', backgroundColor:'black', position:'absolute', top:'180px', right:'10px', rotate:'30deg', transformOrigin:'right' }}/>
    return(
        <div style={{position:'relative', display:'flex', flexDirection:'column', alignItems:'center'}}>
            {head}
            {body}
            {right_hand}
            <div style={{width:'10px', height:'50px', backgroundColor:'black', alignSelf:'end',position:'absolute', top:'10px' }}/>
            <div style={{width:'130px', height:'10px', backgroundColor:'black', alignSelf:'end' }}/>
            <div style={{width:'10px', height:'400px', backgroundColor:'black'}}/>
            <div style={{width:'250px', height:'10px', backgroundColor:'black'}}/>
        </div>
    )
}

export default HangmanDrawing
